import React from 'react';
import ImgSenai from '../../assets/images/Logo_SENAI_PRINCIPAL_VERMELHO.png'
import '../../global.css'

function Header() {
  return (
    <div>
        <nav>
          <div className="principal">
        <img id="icone"src={ImgSenai} alt=""/>
          </div>
            <div className="myDIV"></div>
            
        </nav>

    </div>
  );
}

export default Header;
